import React from "react";

export default function CartItem(props) {
  return (
    <div className="my-3 w-full h-26">
      <input type="checkbox" />
      <div>
        {props.item.title}
        <div>
          <span>{getDayInits(pros.item.days)}</span>
          <span>
            {pros.item.start}-{props.item.end}
          </span>
        </div>
      </div>
    </div>
  );
}
